        name: "State of a component",
        exercises: 14,
    };
    return (
        <div>
            <Header title={course} />
            <Content
                part1={part1.name}
                part2={part2.name}
                part3={part3.name}
                exercises1={part1.exercises}
                exercises2={part2.exercises}
                exercises3={part3.exercises}
            />
            <Total
                total1={part1.exercises}
                total2={part2.exercises}
                total3={part3.exercises}
            />
        </div>
    );
};

export default App;
